import React from "react";
import { useSelector } from "react-redux";
import { Col, Row } from "antd";
import {
  DollarCircleOutlined,
  ShoppingCartOutlined,
  ShoppingOutlined,
  UserOutlined,
} from "@ant-design/icons";
import { Card, Space, Statistic, Typography } from "antd";
import styled from "styled-components";

const DashboardContainer = styled.div`
  padding: 24px;
`;

const DashboardTitle = styled(Typography.Title)`
  margin-bottom: 20px;
`;

const DashboardCardContainer = styled.div`
  display: flex;
  justify-content: space-between;
  margin-bottom: 20px;
`;

const DashboardCard = styled(Card)`
  width: 390px;
  height: 150px;
`;

const DashboardCardContent = styled.div`
  display: flex;
  align-items: center;
`;

const DashboardCardIcon = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  color: ${({ color }) => color};
  background-color: ${({ backgroundColor }) => backgroundColor};
  border-radius: 20px;
  font-size: 24px;
  padding: 8px;
  margin-right: 10px;
`;

const DashboardChartContainer = styled.div`
  display: flex;
  justify-content: space-between;
`;

function Dashboard() {
  const { user } = useSelector((state) => state.auth);

  return (
    <DashboardContainer>
      <DashboardTitle level={4}>Dashboard</DashboardTitle>
      <Row gutter={[24, 24]}>
        <Col span={8}>
          <DashboardCard>
            <DashboardCardContent>
              <DashboardCardIcon
                color="green"
                backgroundColor="rgba(0,255,0,0.25)"
              >
                <UserOutlined />
              </DashboardCardIcon>
              <Statistic title="Users" value={12} />
            </DashboardCardContent>
          </DashboardCard>
        </Col>
        <Col span={8}>
          <DashboardCard>
            <DashboardCardContent>
              <DashboardCardIcon
                color="blue"
                backgroundColor="rgba(0,0,255,0.25)"
              >
                <ShoppingOutlined />
              </DashboardCardIcon>
              <Statistic title="Vehicles" value={5} />
            </DashboardCardContent>
          </DashboardCard>
        </Col>
        <Col span={8}>
          <DashboardCard>
            <DashboardCardContent>
              <DashboardCardIcon
                color="purple"
                backgroundColor="rgba(0,255,255,0.25)"
              >
                <UserOutlined />
              </DashboardCardIcon>
              <Statistic title="Penalties" value={6} />
            </DashboardCardContent>
          </DashboardCard>
        </Col>
      </Row>
      <DashboardChartContainer>
        {/* Add your chart components here */}
      </DashboardChartContainer>
    </DashboardContainer>
  );
}

export default Dashboard;
